export const Genre = {
	ACTION: 'Action',
	COMEDY: 'Comedy',
	DRAMA: 'Drama',
	THRILLER: 'Thriller',
};
export const movies = [
	{
		name: 'The Matrix',
		rating: 7.5,
		genre: Genre.ACTION,
	},
	{
		name: 'Focus',
		rating: 6.9,
		genre: Genre.COMEDY,
	},
	{
		name: 'The Lazarus Effect',
		rating: 6.4,
		genre: Genre.THRILLER,
	},
	{
		name: 'Everly',
		rating: 5.0,
		genre: Genre.ACTION,
	},
	{
		name: 'Maps to the Stars',
		rating: 7.5,
		genre: Genre.DRAMA,
	},
];
